import "./style.css";

function App() {
  return (
    <>
      <header className="header">
        <div className="logo">
          <img src="logo.png" height="90" width="180" alt="GaelGoal Logo" />
        </div>
      </header>

      <main class="main">
        <NewPostForm />
        <TeamFilter />
      </main>
    </>
  );
}

function NewPostForm() {
  return <form>Post Form</form>;
}

function TeamFilter() {
  return <aside>Team Filter</aside>;
}

function PostList() {
  return <section>Post List</section>;
}

export default App;
